import React, { Component, Fragment } from 'react';
import { withRouter } from 'react-router-dom';
import { Input, Button, Col, Icon } from 'react-materialize';
import { Link } from 'react-router-dom';
import TatvamCard from '../../baseComponents/tatvamCard';
import './reviewList.scss';

class Review extends Component {
    constructor(props) {
        super(props);
    }


    render() {
        const list = this.props.data;
        return (
            <Fragment>

                <div className="reviewContainer">
                    <div className="sourceImgBlock">
                        {
                            (() => {
                                if (list.SourceId === null || list.SourceId === " ")
                                    return null
                                if (list.SourceId == '1')
                                    return <span><a href={list.ReviewURL}><img src="data:image/png;base64," /></a></span>
                                if (list.SourceId == '2')
                                    return <span><a href={list.ReviewURL}><img src="data:image/jpeg;base64," /></a></span>
                                if (list.SourceId == '3')
                                    return <span><a href={list.ReviewURL}><img src="data:image/jpeg;base64," /></a></span>
                                else
                                    return null
                            })()
                        }
                    </div>
                    <div className="userDetailBlock">
                        <span> {list.ReviewBy === " " || list.ReviewBy === null ? <a href="">Anonymous</a> : <a href={list.ReviewerProfileURL === '' ? list.ReviewURL : list.ReviewerProfileURL}>{list.ReviewBy}</a>}</span>
                        {/* {list.UserRating === null || list.UserRating === 0 || list.UserRating === '' ? null : <span> {list.UserRating} <img src="data:image/svg+xml;base64," /></span>} */}
                        {
                            (() => {

                                if (list.UserRating === null || list.UserRating === 0)
                                    return null
                                if (list.Recommendations == 'Yes')
                                    return <span><img src="data:image/png;base64," /> Recommends </span>
                                if (list.Recommendations == 'No')
                                    return <span><img src="data:image/png;base64," />doesn't Recommend</span>

                                else
                                    return <span className="userRatingImg"> {list.UserRating} <img src="data:image/svg+xml;base64," /></span>
                            })()
                        }
                        {
                            (() => {

                                if (list.TatvamRating === null || list.TatvamRating === 0)
                                    return null
                                if (list.TatvamRating == '1')
                                    return <span className="tatvamRaiting tRatingImg1">{list.TatvamRating}<img src="data:image/svg+xml;base64," /></span>
                                if (list.TatvamRating == '2')
                                    return <span className="tatvamRaiting tRatingImg2">{list.TatvamRating}<img src="data:image/svg+xml;base64," /></span>
                                if (list.TatvamRating == '3')
                                    return <span className="tatvamRaiting tRatingImg3">{list.TatvamRating}<img src="data:image/svg+xml;base64," /></span>
                                if (list.TatvamRating == '4')
                                    return <span className="tatvamRaiting tRatingImg4">{list.TatvamRating}<img src="data:image/svg+xml;base64," /></span>
                                if (list.TatvamRating == '5')
                                    return <span className="tatvamRaiting tRatingImg5">{list.TatvamRating}<img src="data:image/svg+xml;base64," /></span>
                                else
                                    return null
                            })()
                        }
                        <div><a href={list.ReviewURL}>{list.ReviewDate}</a></div>
                        {list.Title === " " ? null : <div><a href={list.ReviewURL}>{list.Title}</a></div>}
                        {list.Comment === " " ? null : <div className="mt-4x commentBorder">{list.Comment}</div>}
                        <div className="mt-4x">
                            {list.Dimensions.map((rate, i) => {
                                {
                                    (() => {
                                        if (rate.Type = 'Classifier' && rate.Rating == '5')
                                            return <div className="dimension rating5">{rate.Value}</div>
                                        if (rate.Type = 'Classifier' && rate.Rating == '4')
                                            return <div className="dimension rating4">{rate.Value}</div>
                                        if (rate.Type = 'Classifier' && rate.Rating == '3')
                                            return <div className="dimension rating3">{rate.Value}</div>
                                        if (rate.Type = 'Classifier' && rate.Rating == '2')
                                            return <div className="dimension rating5">{rate.Value}</div>
                                        if (rate.Type = 'Classifier' && rate.Rating == '1')
                                            return <div className="dimension rating1">{rate.Value}</div>
                                        else
                                            return null
                                    })()
                                }
                            })}
                        </div>
                    </div>
                </div>
            </Fragment >
        );
    }
}



export default withRouter(Review);